143X)"]},{"cell_type":"markdown","id":"cea2f61b","metadata":{"papermill":{"duration":0.009603,"end_time":"2024-03-14T06:58:53.356687","exception":false,"start_time":"2024-03-14T06:58:53.347084","status":"completed"},"tags":[]},"source":["# Sentiments"]},{"cell_type":"markdown","id":"acddd8ef","metadata":{"papermill":{"duration":0.009494,"end_time":"2024-03-14T06:58:53.376845","exception":false,"start_time":"2024-03-14T06:58:53.367351","status":"completed"},"tags":[]},"source":["## We can retrieve these lexicons using the get_sentiments() function. We can implement this as follows:"]},{"cell_type":"code","execution_count":4,"id":"a33754f5","metadata":{"execution":{"iopub.execute_input":"2024-03-14T06:58:53.40042Z","iopub.status.busy":"2024-03-14T06:58:53.398409Z","iopub.status.idle":"2024-03-14T06:58:53.473259Z","shell.execute_reply":"2024-03-14T06:58:53.471497Z"},"papermill":{"duration":0.089651,"end_time":"2024-03-14T06:58:53.47591","exception":false,"start_time":"2024-03-14T06:58:53.386259","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 6786 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>word</th><th scope=col>sentiment</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>2-faces      </td><td>negative</td></tr>\n","\t<tr><td>abnormal     </td><td>negative</td></tr>\n","\t<tr><td>abolish      </td><td>negative</td></tr>\n","\t<tr><td>abominable   </td><td>negative</td></tr>\n","\t<tr><td>abominably   </td><td>negative</td></tr>\n","\t<tr><td>abominate    </td><td>negative</td></tr>\n","\t<tr><td>abomination  </td><td>negative</td></tr>\n","\t<tr><td>abort        </td><td>negative</td></tr>\n","\t<tr><td>aborted      </td><td>negative</td></tr>\n","\t<tr><td>aborts       </td><td>negative</td></tr>\n","\t<tr><td>abound       </td><td>positive</td></tr>\n","\t<tr><td>abounds      </td><td>positive</td></tr>\n","\t<tr><td>a